export const login = student => {
    const data = {
       student_id: student.student_id,
       password: student.password,
    };

    console.log(data);

    return fetch('http://localhost/user/login/', {
       method: 'POST',
       headers: {
         "Content-type": "application/json",
         'Access-Control-Allow-Origin': '*'
       },
       body: JSON.stringify(data)
    })
    .then(response => {
       return response;
    })
    .catch(err => {
       console.log(err)
    })
 }
